    {
      "cell_type": "markdown",
      "source": [
        "## Background  \n",
        "Looking at house prices is a useful statistical challenge for providing insight into the functioning of the housing market. It can elucidate the relationships between features and enable better future predictions of activity to inform decision-making (1).\n",
        "\n",
        "The dataset used for this report is the well-known 1990 California House Prices, most commonly available from Kaggle, and is of a size good for analysis, being not too toy like nor too cumbersome. There are some published papers (of dubious quality) that have used it, primarily with linear and multiple regression (2, 3).\n",
        "\n",
        "However, some features in the data are spatial and the Moran I test will show how the data are spatially autocorrelated – the observations in spatial data are not independent. This violates one of the crucial assumptions for ordinary least squares (OLS) of independent and identically distributed (iid). When this assumption does hold, Gauss-Markov theorem purports that OLS's estimates that are better than those from all other linear model estimation methods. Ignoring the violation could lead to biased and inefficient parameter estimates (4).\n",
        "\n",
        "Ideally, a spatial lag model or spatial error model would be used - but the author kept crashing both Rstudio and Google Colab with these attempts and consequently has stuck to the fundamental of statistical analysis for the time being. Thus, this report will cover linear and multiple regression and random forest models, with LASSO, ridge regression, elastic net and cross-validation techniques with the aim of discovering which features have the strongest relationship with house prices.\n",
        "\n"
      ],
      "metadata": {
        "id": "IXqMbXlve6nr"
      }
    },
