      "source": [
        "## Method and Results\n",
        "The exploratory data analysis will look at distributions, address outliers, skewness and standardisation. Two new variables will be created; a combination of households and population to create Population_Density, and a combination of total rooms and households to create Rooms_per_House. This will help with multicollinearity.\n",
        "A correlation matrix will be produced and a map of how the target variable of house price is geographically distributed."
