    {
      "cell_type": "markdown",
      "source": [
        "The correlation matrix gives an initial look and certain features jump out. There's also some crossover and double counting."
      ],
      "metadata": {
        "id": "oyNqfdJuxicJ"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "# Remove unnecessary variables\n",
        "df <- df %>%\n",
        "  select(-Households, -Population, -Tot_Rooms)\n",
        "# multicollinearity - these are double counted with the new variables and serve no purpose"
      ],
      "metadata": {
        "id": "wgtJDTvEVuE4"
      },
      "execution_count": 100,
      "outputs": []
    },
    {
      "cell_type": "markdown",
      "source": [
        "The data has spatial qualities. Looking at the following shows how the median house prices are geographically clustered."
      ],
      "metadata": {
        "id": "w_5xwVTbx9uK"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "## Spatial EDA\n",
        "\n",
        "# Convert to spatial data frame\n",
        "df_sf <- st_as_sf(df, coords = c(\"Longitude\", \"Latitude\"), crs = 4326)\n",
        "df_sf$Longitude <- st_coordinates(df_sf)[, 1]\n",
        "df_sf$Latitude <- st_coordinates(df_sf)[, 2]\n",
        "\n",
        "\n",
        "# Plot house prices on a map\n",
        "ggplot(data = df_sf) +\n",
        "  geom_sf(aes(color = Median_House_Value)) +\n",
        "  scale_color_viridis_c() +\n",
        "  theme_minimal() +\n",
        "  labs(title = \"House Prices in California\", color = \"Median House Value\")"
      ],
