      "source": [
        "The Moran I test is a statistical measure that assesses spatial autocorrelation, meaning the correlation of values across different locations in space. It helps determine if values are clustered (similar values near each other), dispersed (similar values spread out), or randomly distributed. Moran's I values range from -1 to 1, with positive values indicating clustering, negative values indicating dispersion, and values close to 0 indicating random distribution."
