    {
      "cell_type": "code",
      "source": [
        "# Calculate spatial weights\n",
        "coords <- cbind(df$Longitude, df$Latitude)\n",
        "nb <- knn2nb(knearneigh(coords, k = 4)) # warning messages, but no time to resolve and they don't invalidate the test\n",
        "lww <- nb2listw(nb, style = \"W\")\n"
      ],
