    {
      "cell_type": "markdown",
      "source": [
        "A moderate negative correlation suggests that properties closer to the coast tend to have higher median house values.\n",
        "\n",
        "The linear regressions are useful, but there may be many features contributing to the price of house and together give a synergistic effect (5). For this a multiple linear regression may provide insight."
      ],
      "metadata": {
        "id": "L2AC63BYq97h"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "## Multiple Linear Regression"
      ],
      "metadata": {
        "id": "K9lVWfAFL-gF"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "Firstly, model_A will look at three variables of income, coastal distance and rooms per house."
      ],
      "metadata": {
        "id": "I_MawQK40Wju"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "## Multiple linear regression modelling ####\n",
        "## model_A\n",
        "linear_reg_spec <- linear_reg() %>%\n",
        "  set_engine(\"lm\")\n",
        "\n",
        "mA_recipe <- recipe(Median_House_Value ~ Median_Income + Distance_to_coast + Rooms_per_House, data = train_data)\n",
        "\n",
        "mA_workflow <- workflow() %>%\n",
        "  add_model(linear_reg_spec) %>%\n",
        "  add_recipe(mA_recipe)\n",
        "\n",
        "mA_fit <- fit(mA_workflow, data = train_data)\n",
        "\n",
        "fitted_mA <- extract_fit_parsnip(mA_fit)\n",
        "summary(fitted_mA$fit)"
      ],
