    {
      "cell_type": "markdown",
      "source": [
        "## Lasso, ridge regression and elastic net  \n",
        "LASSO (Least Absolute Shrinkage and Selection Operator) is a type of linear regression that includes a penalty term proportional to the absolute value of the coefficients. This penalty term encourages sparsity in the model by shrinking some coefficients to exactly zero, effectively performing variable selection. LASSO is particularly useful when dealing with high-dimensional data where the number of predictors exceeds the number of observations - which is not the case here with the housing data, but it shall be tested out because it can help in identifying the most relevant variables and reducing model complexity (5).\n",
        "\n",
        "Ridge regression, on the other hand, adds a penalty term proportional to the square of the coefficients. This penalty term prevents the coefficients from becoming too large, which helps in addressing multicollinearity (as previously mentioned when predictors are highly correlated). Unlike LASSO, ridge regression does not perform variable selection, as it shrinks coefficients towards zero but not exactly to zero. Elastic Net then combines the properties of both LASSO and ridge regression by incorporating both penalty terms. This hybrid approach allows for variable selection and regularisation (5)."
      ],
      "metadata": {
        "id": "juVM2pF9_dPU"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "LASSO"
