    {
      "cell_type": "markdown",
      "source": [
        "The differences in feature importance across models can be attributed to how each model handles regularisation and the inherent characteristics of the data.\n",
        "The multiple regression model considers latitude to be of greater importance than distance to the coast and rooms per house - yet it is of no worth with LASSO, ridge and the hybrid, which instead rate distance to the coast as the second most important feature, followed by population density.\n",
        "Perhaps correlation among predictors? If predictors are highly correlated, LASSO might select one predictor over another, while Ridge and Elastic Net might distribute the importance across correlated predictors."
      ],
      "metadata": {
        "id": "OqxL4bc_Fil-"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "## Random Forest  \n",
        "Random forests are widely used for both classification and regression tasks as they can handle large datasets and provide estimates of feature importance, so it has been chosen here.  \n",
        "It is an ensemble learning method that constructs multiple decision trees during training and merges their results to improve predictive accuracy and control over-fitting. Each tree in the forest is built from a random subset of the data and features, which enhances the model's robustness and generalisation capabilities (5).  \n",
        "It has been reported that in the context of spatial data, random forests are particularly advantageous because they can capture complex spatial patterns and dependencies (6).\n"
      ],
      "metadata": {
        "id": "63pVJE2B99kQ"
      }
    },
    {
      "cell_type": "code",
      "source": [
        "# Prepare the recipe\n",
        "forest_recipe <- recipe(Median_House_Value ~ ., data = train_data)\n",
        "\n",
        "# Define the model with the importance parameter\n",
        "rf_model <- rand_forest(trees = tune()) %>%\n",
        "  set_engine(\"ranger\", importance = \"impurity\") %>%\n",
        "  set_mode(\"regression\")\n",
        "\n",
        "# Create the workflow\n",
        "workflow <- workflow() %>%\n",
        "  add_recipe(forest_recipe) %>%\n",
        "  add_model(rf_model)\n"
      ],
      "metadata": {
        "id": "lmmrqy8Y0bms"
      },
      "execution_count": 129,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "# Define the grid of hyperparameters to tune - 2 minutes usually\n",
        "grid <- grid_regular(trees(range = c(50, 200)), levels = 5)\n",
        "\n",
        "# Perform cross-validation\n",
        "set.seed(451)\n",
        "cv_folds <- vfold_cv(train_data, v = 5)\n",
        "tune_results <- tune_grid(\n",
        "  workflow,\n",
        "  resamples = cv_folds,\n",
        "  grid = grid,\n",
        "  metrics = metric_set(yardstick::rmse, yardstick::rsq, yardstick::mae)\n",
        ")\n",
        "\n",
        "# View cross-validation results\n",
        "tune_results %>%\n",
        "  collect_metrics() %>%\n",
        "  arrange(mean)\n",
        "\n",
        "# Get the best number of trees\n",
        "best_trees <- tune_results %>%\n",
        "  select_best(metric = \"rmse\")\n"
      ],
