    {
      "cell_type": "markdown",
      "source": [
        "Via this methodology, the two features of primary importance are income of the household and the distance the property is from the coast. The number of rooms the house has and how dense the population is also contribute. These four features have also been considered the most important in the regression models.  \n",
        "\n"
      ],
      "metadata": {
        "id": "91UEiA6L-FVB"
      }
    },
    {
      "cell_type": "markdown",
      "source": [
        "## Conclusion\n",
        "Regression is perhaps the most often used technique in statistics. When applied to spatially distributed observations, however, much predictive power can be lost by ignoring the presence of spatial autocorrelation (4).  \n",
        "Nonetheless, this report has attempted to navigate and seek out the most important feature that contribute towards house prices in California.\n",
        "The regression models can be easier to interpret, but the random forest model provides more accurate predictions. This is consistent with the strength of random forests in capturing complex, non-linear relationships in the data (5)."
      ],
      "metadata": {
        "id": "jOCf4x9wvCG3"
      }
    },
